def hextodouble(x):
    return struct.unpack("<d", struct.pack("<Q", x))[0]

def calc(op, x1, x2):
    op = chr(op)
    x1 = hextodouble(x1)
    x2 = hextodouble(x2)
    
    match op:
        case "^":
            try:
                result = math.pow(x1, x2)
            except:
                result = math.nan
        case "%":
            result = math.fmod(x1, x2)
        case _:
            result = eval(f"{x1} {op} {x2}")
    
    return result
    

# Decode flag
for i in range(0, len(ops), 3):
    result = calc(ops[i], ops[i + 1], ops[i + 2])
    
    if result < 0.0 or math.isnan(result) or result == -0.0:
        j = i // 3
        flag[j // 8] ^= 1 << (7 - (j % 8))
        
print(bytes(flag))
